import React from "react";
// import {Navbar,Form,FormControl ,Nav} from "react-bootstrap";
import {Navbar,Nav,Form,link} from "react-bootstrap";
import './SNavbar.css';
function SNavbar() {
    return (

      <div className="FNavbar">

    <Navbar variant="light" style={{backgroundColor:"#white"}}>
    <Navbar.Brand href="#home"></Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#Call Now">Call Now</Nav.Link>
      <Nav.Link href="#Get Direction">Get Direction</Nav.Link>
     </Nav>
     <Form inline>
    <img.Link src="Facebook.png" alt="Facebooklogo"/>
     <img src="instegram.png" alt="instegramlogo"/>
     <img src="snapchat.png" alt="snapchatlogo"/>
     <img src="twitter.png" alt="twitterlogo"/>
    </Form>
   </Navbar>
</div>
  );
}

export default SNavbar;
